import React, { Component } from 'react';
import '../App.css';
import chromeExtensionApi from 'chrome-extension-api';

class PageCopy extends Component {
    
    constructor(){
        super();
        this.state = {
            titulo : ''

        }
        
    }



  render() {
    return (
        <div className="container">
            <form id="create-course-form" className="card-body" onSubmit={this.guardarTarea}>
                HOME!!!!!!!
                
            </form>
        </div>
    );
  }
}

export default PageCopy;
